    "2015-01-22T15:57:43.583901",nt"name": "hopwa-grantee-areas",nt"isopen":
    false,nt"url": null,nt"notes": "The Housing Opportunities for Persons with
    AIDS (HOPWA) program is the only Federal program dedicated to address housing needs
    for low-income persons who are living with HIV/AIDS and their families. Funds are
    distributed to states and cities by formula allocations and made available as part
    of the area's Consolidated Plan. In addition, some projects are selected in national
    competitions to serve as service delivery models or operate in non-formula areas.
    Grantees partner with nonprofit organizations and housing agencies to provide housing
    and support to beneficiaries.",nt"license_title": "License Not Specified",nt"extras":
